      border-top-left-radius: 20px;
      border-top-right-radius: 20px;
    }

      width: 100%;

      font-weight: bold;
      font-size: 1.2rem;

      display: inline-flex;
      align-items: center;
      gap: 6px;

    .status-live {
      background: #e50914;
      color: #fff;
    }

      background: #0B7AAD;
      color: #fff;
